.arrow {
  font-size: $arrowSize;
  color: $black;
  cursor: pointer;

  &::before  {
    transition: .5s;
  }

  &:hover::before {
    color: $white;
  }

  &-container {
    position: absolute;
    z-index: 400;
    bottom: 5%;
    left: 50%;
    transform: translateX(-50%);
    // width: 100%;
    max-width: 1050px;
    height: 50px;
    opacity: 0;
    transition: 1s;
    // transition-delay: 2s;

    &.inview {
      opacity: 1;

      .arrow {
        &.down {
          transform-origin: top;
          animation: down 2s linear infinite;
        }
        &.right {
          transform-origin: left;
          animation: right 2s linear infinite;
        }
      }
    }
  }
}

.coach, .sns {
  .arrow-container {
    bottom: calc(5% + 17px);
  }
}

@keyframes down {
  0%,
  100% {
    transform: translateY(-10px);
    opacity: 0.1;
  }
  60% {
    transform: none;
    opacity: 1;
  }
}
@keyframes right {
  0%,
  100% {
    transform: none;
    opacity: 0.1;
  }
  60% {
    transform: translateX(10px);
    opacity: 1;
  }
}

