        left: 0;
        bottom: 0;
        width: 100%;
        height: 3px;
        transform: scaleX(0);
        transform-origin: right;
      }
      span:nth-child(3) {
        right: 0;
        bottom: 0;
        width: 3px;
        height: 100%;
        transform: scaleY(0);
        transform-origin: top;
        transition-delay: 0.5s;
