/******************************************************************

Stylesheet: ベーススタイル

******************************************************************/

* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
  -webkit-overflow-scrolling: touch;
  // font-family: "M PLUS Rounded 1c", sans-serif;
  font-family: "M PLUS 1p", sans-serif;
}
body {
