}

h2,
.heading {
  position: relative;
  font-size: $fsH2;
  font-weight: 900;
  font-style: italic;
  color: $white;
}
h2 {
  // filter: drop-shadow(-3px -3px 2px rgba(27, 38, 44, 0.4))
